import "./App.css";
import { Routes, Route } from "react-router-dom";
import Home from "./Home";
import Novels from "./Novels";

//API-KEY = "dc1b51ef-4895-437a-9528-7eb6dc0ea43a";

const App = () => {
  return (
    <div className="site">
      <Routes>
        <Route path="/Home" element={<Home />} />
        <Route path="/Novels" element={<Novels />} />
      </Routes>
    </div>
  );
};

export default App;
